import React from 'react';
import {Link} from 'react-router-dom'
import '../Card.css'
import studentImg from '../images/alumno.png'

class MenuPrincipal extends React.Component{
    
  render(){
    return(
        <div className="Menu">
            <h1>Este es el menu principal</h1>
            <div className="card">
                <div>
                    <img src={studentImg} width="100%" height="100%" className="float-right"/>
                </div>
            </div>
            
            <div>
                <Link to="/catalogo">Cat√°logo de Profesores</Link>
            </div>
        </div>
    )
  }
}

export default MenuPrincipal;
